import React from "react";
import { Link } from "react-router-dom";


function StartPage() {
  return (
    <div>
      <h1>Welcome to the Website</h1>
      <div>
        <Link to="/login" >
          <button href="/Login">Login</button>
        </Link>
      </div>
      <div>

        <Link to="/signup">
          <button href="/SignUp">Sign Up</button>
        </Link>
      </div>

    </div>
  );
}

export default StartPage;
